import {FaReact, FaHTML5, FaCSS3, FaJsSquare, FaNodeJs, FaPython, FaJava, FaDatabase, FaGitAlt} from 'react-icons/fa';
import {SiExpress, SiPostgresql, SiMysql, SiRestapi, SiVisualstudiocode, SiOracle, SiPostman} from 'react-icons/si';

function Skills() {
    const skillCategories = [
        {
            title: "Frontend Development",
            icon: <img src="public/image/Frontend.png" alt="Frontend Icon"/>,
            skills: [
                {icon: "", name: "React.js"},
                {icon: "", name: "HTML"},
                {icon: "", name: "CSS"},
                {icon: "", name: "JavaScript"}

            ],
        },
        {
            title: "Backend Development",
            icon: <img src="public/image/Backend.png" alt="Backend Icon"/>,
            skills: [
                {icon: "", name: "Node.js"},
                {icon: "", name: "Express.js"},
                {icon: "", name: "Python"},
                {icon: "", name: "Java"},
                {icon: "", name: "C"},
                {icon: "", name: "PostgreSQL"},
                {icon: "", name: "SQL"},
                {icon: "", name: "REST APIs"}
            ],
        },
        {
            title: "Tools",
            icon: <img src="public/image/tools.png" alt="tools Icon"/>,
            skills: [
                {icon: "", name: "Git/Github"},
                {icon: "", name: "VS Code"},
                {icon: "", name: "Oracle VirtualBox"},
                {icon: "", name: "Postman"}
            ],
        },

        {
            title: "Soft Skills",
            icon: <img src="public/image/SoftSkills.png" alt="Soft Skills Icon"/>,
            skills: [
                {icon: <span></span>, name: "Problem Solving"},
                {icon: <span></span>, name: "Teamwork"},
                {icon: <span></span>, name: "Communication"},
                {icon: <span></span>, name: "Adaptability"},
                {icon: <span></span>, name: "Time Management"},
                {icon: <span></span>, name: "Critical Thinking"},
                {icon: <span></span>, name: "Attention to Detail"},
            ],
        },
    ];

    return (
        <section id="Skills" className="skills-section">
            <h2>Skills</h2>
            <div className="skills-categories">
                {skillCategories.map((category) => (
                    <div key={category.title} className="skills-category">
                        <h3>{category.title}</h3>
                        <ul>
                            {category.skills.map((skill) => {
                                <li key={skill.name}>{skill.name}</li>
                            })}
                        </ul>
                    </div>
                  ))}
                  </div>
                </section>
    );
}

export default Skills;
